window.bookSummaryJSON = "<p>She was never supposed to walk into my club.&nbsp;But she did.&nbsp;</p> <p>I shouldn’t have looked twice at her.&nbsp;But I did.&nbsp;&nbsp;&nbsp;</p> <p>The criminal underworld is no place for a girl like her.&nbsp;&nbsp;&nbsp;</p> <p>One night with Katerina isn’t enough, but men like me can’t afford to be weak.&nbsp;So, I tell her to leave me behind.&nbsp;She does, but not before she sees something she shouldn’t.&nbsp;&nbsp;&nbsp;</p> <p>When she goes into hiding, it’s my duty to hunt her down.&nbsp;I have a job to do, and she needs to disappear for good.&nbsp;&nbsp;&nbsp;</p> <p>But four years later, Kat isn’t alone anymore.&nbsp;And the little boy right beside her looks just like me.&nbsp;</p>"; 
